export default function TableCsv() {
  const [data, setData] = useState<any>([]);
  const [header, setHeader] = useState<any>([]);
  const [rows, setRows] = useState<any>([]);
  const [query, setQuery] = useState<string>("")

  const search = async (e: any) => {
    // if (e.key === "Enter") {
    //   // const res: any = await FetchData(query);
    //   console.log(query);
    //   setQuery('')
    // }

  }

  function filterData() {
    console.log("filter data")
    return query
      ? rows.filter((obj: any) => {
        var flag = false;
        Object.values(obj).forEach((val: any) => {
          if (
            String(val ? val.toLowerCase() : val).indexOf(
              query.toLowerCase()
            ) > -1
          ) {
            flag = true;
            return;
          }
        });
        if (flag) return obj;
      })
      : rows;
  }

  useEffect(() => {
    readRemoteFile('/alkoholilupa_toimipaikkatiedot_34.csv', {
      complete: (results: any) => {
        // console.log('Results:', results)
        setData(results)
        setHeader(results.data.shift());
        setRows(results.data);
        // }
      }
    });
    // readRemoteFile('http://example.com/big.csv', {
    //   step: (row) => {
    //     console.log('Row:', row.data)
    //   },
    //   complete: () => {
    //     console.log('All done!')
    //   }
    // })
  }, [])

  return (
    <div className="card ">
      <div className="card-header">
        <h4 className="card-title"> Top Alcohol Place</h4>
      </div>
      {/* <div>
        <label className="text-center" >Search Place
        <input id="searchAlcohol" name="searchAlcohol" type="text" className="search" placeholder="Search..." value={query} onChange={(e) => setQuery(e.target.value)} onKeyPress={search} />
        </label>
      </div> */}
      <div className="input-group-prepend mb-3 pl-2 pr-2">
        <input type="text" className="form-control border search" placeholder="Search..." value={query} onChange={(e) => setQuery(e.target.value)} onKeyPress={search} aria-label="search place" aria-describedby="alcohol" />
        {/* <div className="input-group-append">
          <button className="btn btn-secondary" type="button">Button</button>
        </div> */}
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table tablesorter " id="">
            <thead className=" text-primary">
              <tr>
                {header && (header.map((name: string, ii: number) => (
                  <th key={ii}>{name}</th>)
                ))}
              </tr>
            </thead>
            <tbody>
              {filterData() &&
                (filterData().map((numList: any, i: number) => (
                  <tr key={i} >
                    {
                      numList.map((num: any, j: number) =>
                        <td key={j}>{num}</td>)
                    }
                  </tr>)
                ))
              }
            </tbody>
          </table>
        </div>
      </div>
      <div className="card-header">
        <h4 className="card-title"> Simple Table</h4>
        {typeof (data.columns)}
        {(data.columns)}
        {/* {data.length > 0 ? data[0] : ''} */}
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table tablesorter " id="">
            <thead className=" text-primary">
              <tr>
                {data.columns && data.columns.map((name: string, i: number) => (
                  <th key={i}>name</th>
                ))}
                <th>Country</th>
                <th>City</th>
                <th className="text-center">Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Dakota Rice</td>
                <td>Niger</td>
                <td>Oud-Turnhout</td>
                <td className="text-center">$36,738</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  )
}

